import React from 'react';
import './navbar.css';

function Navbar() {
   return (
<div class="navbar-content">
   <div class="logo">
   Twemoji 2.0
   </div>
   <div class="navbar-text">
      <p>Product</p>
      <p>Features</p>
      <p>Marketplace</p>
      <p>Company</p>
      <p>Log-in</p>
   </div>
</div>
 )}

export default Navbar;
